  const [name, setName] = useState("НАЖМИ НА ПРАВЕЛЬНУЮ КНОПКУ");

  let history = useHistory();

  return (
    <div className="App">


      <Switch>
        <Route path="/main">
          <Body />
        </Route>
        <Route path="/">
          <Body />
        </Route>
        <Redirect from="" to="/main" />
      </Switch>
    </div>
  );
}

export default App;
